module Services
  class GeolocationService
    class Location
      attr_reader :city, :state, :zip, :country_code, :latitude, :longitude, :magnetic_latitude

      def initialize(data)
        @city = data[:city]
        @state = data[:state]
        @zip = data[:zip]
        @country_code = data[:country_code]
        @latitude = data[:latitude]
        @longitude = data[:longitude]
        @magnetic_latitude = data[:magnetic_latitude]
      end

      def invalid?
        @latitude.blank? || @longitude.blank?
      end

      def international?
        @country_code != "US"
      end
    end

    def initialize
      @local_cache = {}
    end

    def geocode(location)
      return Location.new({}) if location.nil? || location.strip.blank?
      @local_cache[location] ||= lookup_location(location)
    end

    private

    def lookup_location(location)
      geo = Geokit::Geocoders::MultiGeocoder.geocode(location)
      if geo.success
        Location.new(:city => geo.city,
                     :state => geo.state,
                     :zip => geo.zip,
                     :country_code => geo.country_code,
                     :latitude => geo.lat,
                     :longitude => geo.lng,
                     :magnetic_latitude => calculate_magnetic_latitude(geo.lat, geo.lng))
      else
        nil
      end
    end

    # Algorithim and data to calculate adjusted magnetic latitude taken from
    # http://www.swpc.noaa.gov/Aurora/aurora.js
    def calculate_magnetic_latitude(latitude, longitude)
      return nil if latitude.blank? || longitude.blank?

      ilat1 = ((90.0 - latitude) / 2.0 - 1).floor
      ilat2 = ilat1 + 1
      ilon1 = (longitude / 5.0).floor
      ilon2 = ilon1 + 1

      # Wrap if lon = 360 degrees
      if ilon2 > 71
        ilon2 = 0
      end

      ind11 = ilat1 * 72 + ilon1
      ind12 = ilat1 * 72 + ilon2
      ind21 = ilat2 * 72 + ilon1
      ind22 = ilat2 * 72 + ilon2

      # Set up interpolation
      del1 = (longitude - ilon1 * 5.0) / 5.0
      
      c = conversion_array
      a1 = c[ind11] + del1 * (c[ind12] - c[ind11])
      a2 = c[ind21] + del1 * (c[ind22] - c[ind21])
      del2 = (latitude - (90.0 - ((ilat2 + 1) * 2.0))) / 2.0

      (a2 + del2 * (a1-a2)).floor
    end

